import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import NavBar from './Navbar';

export default function Home(){
    return (
        <>
            <NavBar />
            <Container>
                <Row>
                    <Col>
                        Hello
                    </Col>
                </Row>
            </Container>
        </>
    );
}
